import React from "react";

function Footer() {
  return (
    <div>
      <footer>
        <p>Created by Bastien Adam</p>
        <div class="social-link-container">
          <a class="social-link" href="">
            <i class="fab fa-dribbble"></i> Dribbble
          </a>
          <a class="social-link" href="">
            <i class="fas fa-desktop"></i> Portfolio
          </a>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
